import JoblyApi from "./api";
import { useNavigate } from "react-router-dom";
import useLocalStorage from "./hooks/useLocalStorage";


const Logout = ({setCurrentUser,setToken}) => {
    const Navigate = useNavigate();
    setCurrentUser();
    setToken();
    JoblyApi.token = '';

    return Navigate('/');
}

export default Logout;
